midA=mid*above(mid,0.6);
tm_a=tm_a + (midA*midA)/10;
q1=tm_a/3;

tm_b=tm_b + bass*bass/10;
q2=tm_b/3;

mv_r=sin(time)*0.7 + 0.7;
mv_r=mv_r*mv_r;
mv_g=sin(time+2)*0.7 + 0.7;
mv_g=mv_g*mv_g;
mv_b=sin(time+4)*0.7 + 0.7;
mv_b=mv_b*mv_b;


